function config (envs,dirs,files) {
  //console.log(envs,dirs,files)
  return {

    /** development or production, determines
     * ref:
     */
    mode: envs.MODE,

    /** tell webpack where src, build, dist is
     * ref:
     */
    context: dirs.root,

    /** process rules for filetypes
     * ref:
     */
    module: {
      rules: [
        {
          test:  /\.(js|jsx|mjs)$/,
          loader: 'babel-loader',
        },
        {
          test: /\.(css|less|styl|scss|sass|sss)$/,
          loader: 'css-loader',
          options: {
            importLoaders: 1,
            modules: true,
          },
        },
      ],
    },
  };
}

